// src/theme.js
import { createTheme } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
      main: '#FF5722',
    },
    secondary: {
      main: '#4CAF50',
    },
    error: {
      main: '#F44336',
    },
    warning: {
      main: '#FF9800',
    },
    info: {
      main: '#2196F3',
    },
    success: {
      main: '#4CAF50',
    },
    background: {
      default: '#FFFFFF',
    },
    text: {
      primary: '#212121',
    },
  },
  typography: {
    fontFamily: [
      'Roboto',
      'Helvetica',
      'Arial',
      'sans-serif'
    ].join(','),
    h1: {
      fontSize: '36px',
    },
    h2: {
      fontSize: '32px',
    },
    h3: {
      fontSize: '28px',
    },
    h4: {
      fontSize: '24px',
    },
    h5: {
      fontSize: '20px',
    },
    h6: {
      fontSize: '16px',
    },
    body1: {
      fontSize: '14px',
    },
    body2: {
      fontSize: '12px',
    },
  },
});

export default theme;
